package oss

import (
	"encoding/base64"
	"strings"
	"testing"
)

func TestOssClient_PushFile(t *testing.T) {
	client, err := NewOssClient(AccessKeyId, AccessKeySecret, Endpoint, "ifortune")
	if err != nil {
		t.Errorf("%v", err)
		return
	}
	err = client.PushFile("nihao/aha.jpg", "hehe.jpeg")
	if err != nil {
		t.Errorf("%v", err)
		return
	}
	t.Log("success")
}

var testImage = ""

func TestOssClient_PushFileWithIOReader(t *testing.T) {
	client, err := NewOssClient(AccessKeyId, AccessKeySecret, Endpoint, "ifortune")
	if err != nil {
		t.Errorf("%v", err)
		return
	}
	decoder := base64.NewDecoder(base64.StdEncoding, strings.NewReader(testImage))
	err = client.PushFileWithIOReader("nihao/ok.jpeg", decoder)
	if err != nil {
		t.Errorf("%v", err)
		return
	}
	t.Log("success")
}
